import React from 'react';
import '../css/main.css';

function ErrorsRowTable(props) {
    console.log(props);
    return (
        <tr className="table__row--body table__row--error" data-id={props.id}>
            <td className="table__cell table__cell--body">{props.time}</td>
            <td className="table__cell table__cell--body">{props.code}</td>
            <td className="table__cell table__cell--body">{props.text}</td>
        </tr>
    );
}

export default ErrorsRowTable;
